  const getDonations = async () => {
    const donations = await fetchDonations();
    setDonations(donations);
  };
  getDonations();
}, []);

const fetchDonations = async () => {
  const response = await axios.get("http://localhost:8080/get_all_EVENTS");
  return response.data;
};

